import React from "react";
import "./MainPage.css";
import Title from "./TechLogo";
function MainPage()
{
    return(
        <div id="content-wrapper">
            <div id="titles">
            <div>
                    <Title
                        fontWeight="lighter"
                        fontSize="150px"
                        color="#666666"
                        textAlign="center"
                        text="#TECH"
                        marginTop="0px"
                    />
                </div>
                <div>
                    <Title/>
                </div>
            </div>
            
        </div>
    );
}

export default MainPage;
